import React from 'react';

function Footer() {
  return (
    <footer>
      <div className="jumbotron1 jumbotron-fluid py-5">
        <div className="container text-center">
          <p>&copy; Chatty 2020.</p>
        </div>
      </div>
    </footer>
  )
}

export default Footer;
